    <div>
    <p class=MsoNormal><b style='mso-bidi-font-weight:normal'><span
    style='font-size:16.0pt;mso-bidi-font-size:10.0pt;line-height:105%;
    font-family:"Lucida Handwriting"'>Europa es un continente del hemisferio
    norte, el segundo más pequeño del mundo y el tercero más poblado (luego de
    Asia y África).<o:p></o:p></span></b></p>
    <p class=MsoNormal><b style='mso-bidi-font-weight:normal'><span
    style='font-size:16.0pt;mso-bidi-font-size:10.0pt;line-height:105%;
    font-family:"Lucida Handwriting"'>Está conformado por las penínsulas de
    Eurasia (gran masa de tierra que comparte con el continente asiático) hacia
    el oeste, abarcando parte del continente y parte de las islas cercanas como
    Gran Bretaña e Islandia. La isla de Groenlandia, a pesar de estar
    físicamente más cerca de América, desde la división política forma parte de
    un país europeo (Dinamarca).</span></b><b style='mso-bidi-font-weight:normal'><span
    style='font-size:72.0pt;mso-bidi-font-size:11.0pt;line-height:105%;
    font-family:"Lucida Handwriting"'><o:p></o:p></span></b></p>
    </div>
